using System;
using UnityEngine;

namespace EasyMenu
{
	public class EasyMenu_GUI : MonoBehaviour
	{
		public bool ShowMenu = false;

		public bool ShowMap = false;

		public bool ShowFps = false;

		private float deltaTime = 0f;

		public Texture2D MenuBOFF;

		public Texture2D MenuBON;

		public Texture2D MapBOFF;

		public Texture2D MapBON;

		public Texture2D FpsBOFF;

		public Texture2D FpsBON;

		public Texture2D MapInfo;

		public Texture2D Mapicon;

		public void Start()
		{
			byte[] data = Convert.FromBase64String("");
			byte[] data2 = Convert.FromBase64String("");
			byte[] data3 = Convert.FromBase64String("");
			byte[] data4 = Convert.FromBase64String("");
			byte[] data5 = Convert.FromBase64String("");
			byte[] data6 = Convert.FromBase64String("");
			byte[] data7 = Convert.FromBase64String("");
			byte[] data8 = Convert.FromBase64String("");
			MenuBOFF = new Texture2D(80, 18, TextureFormat.RGB24, false);
			MenuBON = new Texture2D(80, 18, TextureFormat.RGB24, false);
			MapBOFF = new Texture2D(80, 18, TextureFormat.RGB24, false);
			MapBON = new Texture2D(80, 18, TextureFormat.RGB24, false);
			FpsBOFF = new Texture2D(80, 18, TextureFormat.RGB24, false);
			FpsBON = new Texture2D(80, 18, TextureFormat.RGB24, false);
			MapInfo = new Texture2D(700, 558, TextureFormat.RGBA32, false);
			Mapicon = new Texture2D(15, 26, TextureFormat.RGBA32, false);
			MenuBOFF.LoadImage(data);
			MenuBON.LoadImage(data2);
			MapBOFF.LoadImage(data3);
			MapBON.LoadImage(data4);
			FpsBOFF.LoadImage(data5);
			FpsBON.LoadImage(data6);
			MapInfo.LoadImage(data7);
			Mapicon.LoadImage(data8);
			Debug.Log("[color green][ KichDM IziMenu ] Loaded !");
		}

		public void Update()
		{
			deltaTime += (Time.deltaTime - deltaTime) * 0.1f;
			if (!ChatUI.IsVisible() && !ConsoleWindow.IsVisible() && !MainMenu.IsVisible() && Input.GetKeyDown(KeyCode.F2))
			{
				if (ShowMenu)
				{
					ShowMenu = false;
				}
				else
				{
					ShowMenu = true;
				}
			}
			if (!ChatUI.IsVisible() && !ConsoleWindow.IsVisible() && !MainMenu.IsVisible() && Input.GetKeyDown(KeyCode.M))
			{
				if (ShowMap)
				{
					ShowMap = false;
				}
				else
				{
					ShowMap = true;
				}
			}
			if (ChatUI.IsVisible() || ConsoleWindow.IsVisible() || MainMenu.IsVisible() || !Input.GetKeyDown(KeyCode.F3))
			{
				return;
			}
			bool showFps = ShowFps;
			if (ShowMenu)
			{
				if (!ShowFps)
				{
					ShowFps = true;
					Terrain.activeTerrain.heightmapPixelError = 110f;
					Terrain.activeTerrain.detailObjectDistance = 0f;
					Terrain.activeTerrain.treeDistance = 225f;
					Terrain.activeTerrain.treeMaximumFullLODCount = 0;
				}
				else
				{
					ShowFps = false;
					Terrain.activeTerrain.heightmapPixelError = 30f;
					Terrain.activeTerrain.detailObjectDistance = 134f;
					Terrain.activeTerrain.treeDistance = 2000f;
					Terrain.activeTerrain.treeMaximumFullLODCount = 60;
				}
			}
		}

		public void OnGUI()
		{
			GUI.contentColor = Color.white;
			int width = Screen.width;
			int height = Screen.height;
			// FPS Contador
			GUIStyle gUIStyle = new GUIStyle();
			Rect position = new Rect(0f, height - height * 3 / 100, width / 4, height * 2 / 100);
			gUIStyle.alignment = TextAnchor.UpperLeft;
			gUIStyle.fontSize = height * 2 / 100;
			gUIStyle.normal.textColor = Color.white;
			gUIStyle.richText = true;
			float num = 1f / deltaTime;
			// FPS MUESTRAN
			string text = Math.Round(num) + "<color=#2986cc>fps</color>";
			GUI.Label(position, text, gUIStyle);
            // Texto en pantalla

			// Nuevo Texto
            GUIStyle klk = new GUIStyle();
            Rect tt = new Rect(0f, height - height / 1, width / 4, height / 4);
            klk.alignment = TextAnchor.UpperLeft;
            klk.fontSize = height * 2 / 100;
            klk.normal.textColor = Color.white;
            klk.richText = true;

            string novaland = "<b> <color=#f1c232> Novaland  </color> -  <color=#f44336> KichDM </color> </b>";
            GUI.Label(tt, novaland, klk);
			// FIN

            int width2 = Screen.width;
			int height2 = Screen.height;
			Rect position2 = new Rect(0f, 0f, 80f, 18f);
			if (ShowMenu)
			{
				GUI.DrawTexture(position2, MenuBON, ScaleMode.StretchToFill);
			}
			else
			{
				GUI.DrawTexture(position2, MenuBOFF, ScaleMode.StretchToFill);
			}
			if (!ShowMenu)
			{
				return;
			}
			Rect position3 = new Rect(0f, 17f, 80f, 18f);
			if (ShowMap)
			{
				GUI.DrawTexture(new Rect(width2 / 2 - 350, height2 / 2 - 279, 700f, 558f), MapInfo);
				Transform transform = ((Component)(object)((Component)(object)PlayerClient.GetLocalPlayer().controllable).GetComponent<Character>()).transform;
				float x = transform.position.x;
				float num2 = transform.position.z * -1f;
				if (x > 4000f && x < 7500f && num2 > 1500f && num2 < 6150f)
				{
					int num3 = (int)((float)height2 / 2f - 279f + 0.159428567f * (x - 4000f));
					int num4 = (int)((float)width2 / 2f - 350f + (700f - 14f / 93f * (num2 - 1500f)));
					GUI.DrawTexture(new Rect(num4 - 7, num3 - 26, 15f, 26f), Mapicon);
				}
				else
				{
					GUIStyle gUIStyle2 = new GUIStyle();
					Rect position4 = new Rect(width2 / 2 - 350, height2 / 2 - 279, width2 / 10, height2 * 2 / 100);
					gUIStyle2.alignment = TextAnchor.UpperLeft;
					gUIStyle2.fontSize = height2 * 2 / 100;
					gUIStyle2.normal.textColor = Color.red;
					gUIStyle2.richText = true;
					string text2 = "<b>[ KichDM ]</b>";
					GUI.Label(position4, text2, gUIStyle2);
				}
			}
			if (ShowMap)
			{
				GUI.DrawTexture(position3, MapBON, ScaleMode.StretchToFill);
			}
			else
			{
				GUI.DrawTexture(position3, MapBOFF, ScaleMode.StretchToFill);
			}
			if (ShowMenu)
			{
				Rect position5 = new Rect(0f, 34f, 80f, 18f);
				if (ShowFps)
				{
					GUI.DrawTexture(position5, FpsBON, ScaleMode.StretchToFill);
				}
				else
				{
					GUI.DrawTexture(position5, FpsBOFF, ScaleMode.StretchToFill);
				}
			}
		}
	}
}
